import React, { useEffect, useState } from "react";

const App = () => {
  const [name, setname] = useState(0);
  const [names,setnames]=useState(0);

  useEffect(()=>{
    alert('Hey! I am Clicked!!');
  },[])
  return (
    <>
    <button
      onClick={() => {
        setname(name + 1);
      }}
    >
      Click Me {name}
    </button>
    <br/>
    <button
      onClick={() => {
        setnames(names + 1);
      }}
    >
      Click Me {names}
    </button>
    </>
  );
};
export default App;
